import axios from './axios'
const APP_URL = '/api/v1/'

async function getContainer(){
	const response = await axios.get(APP_URL, { params: { containerName: 'test123' } })
	return response
}

const containerGatherer = {
  getContainer,
}

export default containerGatherer
